import React, { useContext } from "react";
import "./UserLayoutStyle.css";
import { Link } from "react-router-dom";
import UserContext from "../../utils/UserContext";

const UserLayout = ({ LogOut, children }) => {
  const [{ user }] = useContext(UserContext);
  return (
    <div className="user_layout">
      <div className="user_layout_sidebar">
        <h3>Навигация</h3>
        <Link className="user_sidebar_option" to={"/my_profile"}>
          Моят профил
        </Link>
        <div className="user_sidebar_option" onClick={LogOut}>
          Изход
        </div>
        {user.username && user.role === "ADMIN" ? (
          <>
            <div className="user_recipes_holder">
              <h3>Рецепти</h3>
              <Link className="user_sidebar_option" to={"/my_profile"}>
                Създай рецепта
              </Link>
              <div className="user_sidebar_option" onClick={LogOut}>
                Редактирай рецепта
              </div>
            </div>
            <div className="user_recipes_holder">
              <h3>Категории</h3>
              <Link className="user_sidebar_option" to={"/my_profile"}>
                Създай Категория
              </Link>
              <div className="user_sidebar_option">Редактирай Категория</div>
            </div>
          </>
        ) : null}
      </div>

      <div className="user_content_layout">{children}</div>
    </div>
  );
};

export default UserLayout;
